import React, { Component } from 'react';
import { FaFacebookF, FaGooglePlusG, FaTwitter, FaLinkedinIn, FaInstagramSquare} from 'react-icons/fa';


class TopNavLeftIcon extends Component {
    render() {
        return (
            <ul className="list-inline hover-red">
                <li><a href="https://www.facebook.com/" title="Facebook"><FaFacebookF/></a></li>
                <li><a href="https://plus.google.com/" title="Google+"><FaGooglePlusG/></a></li>
                <li><a href="https://www.twitter.com/" title="Twitter"><FaTwitter/></a></li>
                <li><a href="https://www.linkedin.com/" title="LinkedIn"><FaLinkedinIn/></a></li>
                <li><a href="https://www.instagram.com/" title="Instagram"><FaInstagramSquare/></a></li>
            </ul>
        );
        }
}

export default TopNavLeftIcon;
